import React from "react";

export default function Skills(props) {
  return (
    <div className="skills">
      <p className="skills-info">Update Skills Info:</p>

      <form
        onSubmit={(e) => {
          e.preventDefault();
        }}
      >
        <label htmlFor="skill">Skill:</label>
        <div className="skill-input-section">
          <input
            type="text"
            id="skill"
            placeholder="Enter Skill"
            className="personal-inputs"
            value={props.skillValue}
            name={props.skillHolder}
            onChange={props.onSkillChange}
          />
          <span>Add Skill</span>
          <button className="add-skill-btn" onClick={props.onSkillChange}>
            +
          </button>
        </div>
      </form>
    </div>
  );
}
